Maak kennis met Lea Meijer, een vrouw die jong, mooi, rijk en gelukkig getrouwd is met Harry. Op een kwade dag besluit Harry dat 
hij een kind wil. Lea stemt toe, nadat ze zijn overeengekomen dat hij haar elke avond zal nemen. En met een fulltime au-pair 
hoeft haar leven toch niet echt te veranderen? De bevalling wordt een langdurige hel compleet met tangverlossing en 
totaalruptuur. Maar Junior blijkt gezond en Harry is dolgelukkig. Maar Lea niet.
